import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Login from './components/js/login';
import SignUpOne from './components/js/signUpOne';
import SignUpTwo from './components/js/signUpTwo';
import Productivity from './components/js/productivity';
import SchedulePage from './components/js/schedulePage';

const Stack = createStackNavigator();

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUpOne" component={SignUpOne} />
        <Stack.Screen name="SignUpTwo" component={SignUpTwo} />
        <Stack.Screen name="Productivity" component={Productivity} />
        <Stack.Screen name="SchedulePage" component={SchedulePage} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
